import React from 'react';
import Activity from './Activity';

const DayView = ({ day, activities, onToggle }) => (
  <div className="day-view">
    <h3>{day}</h3>
    <div className="activities-container">
      {activities.map(activity => (
        <Activity 
          key={activity.id} 
          activity={activity} 
          onToggle={onToggle} 
        />
      ))}
    </div>
  </div>
);

export default DayView;
